import Navigationbar from "./navbar";
import "bootstrap/dist/css/bootstrap.css";
import Head from "next/head";

function App() {
	return (
		<div>
			<Head>
				<title>Home</title>
			</Head>
			<h1>This is Home Page</h1>
			<Navigationbar />
		</div>
	);
}

export default App;
